  \"2016-01-07T13:53:00.093991\",\n\t\"name\": \"estimating-goose-populations-at-izembek-lagoon-with-airborne-electronic-imaging-devices-19\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Accurate estimates of population size during
  nesting, migration, andwintering are important for management of waterfowl. For
  this reason,aerial counts of black brant Branta bernicla nigricans have beenconducted
  regularly at Izembek Lagoon on the Alaska peninsula during fallstaging and in several
  lagoons on the Baja peninsula of Mexico. Thesecounts are flown with irregular flight
  paths to cover all possible habitatsin the Lagoon. Total population counts are accumulated
  by observersexperienced in estimating flock size. Based on many years of estimates,population
  trend information appears to be reliable. The precision andbias of a single population
  count are not known. Shortcomings of aerialsurveys have been discussed by Caughley
  1974, 1976, 1978. The need foraccurate population estimates and the encouraging
  performance of airbornevideo cameras in detecting nests of black brant prompted
  experimentalsurveys at Izembek Lagoon in 1991 with a high resolution video camera
  and anewly developed, high resolution, digital camera. This report summarizesthe
  results of the camera tests.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
